-- Volcando estructura para procedimiento daimler.PA_DAICapEmpleados
DELIMITER //
CREATE PROCEDURE `PA_DAICapEmpleados`(IN jsonParametros JSON)
BEGIN
	DECLARE 	strOpcion varchar(10) ;
	DECLARE 	strUsuario VARCHAR(30);
	DECLARE 	strCodigo varchar(10) ;
	DECLARE		strDetalle varchar(255);	
	DECLARE		intEstatus INT ;
	DECLARE		intIdEmpleado BIGINT;
	DECLARE		intId			BIGINT;
    DECLARE		intIdPaquete	BIGINT;
    DECLARE 	dteFechaIngreso date;
    DECLARE		blnActivo		bit;
    DECLARE		intFirmaGafete 	bigint;
    DECLARE		dteFechaEntrega	date;
	DECLARE		intTallaCamisa	bigint;	
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
	BEGIN 
		rollback;
		GET DIAGNOSTICS CONDITION 1 strCodigo = RETURNED_SQLSTATE, strDetalle= MESSAGE_TEXT;
		SELECT 200 as intEstatus,strCodigo,strDetalle as strDetalle;
	END;
	DECLARE EXIT HANDLER FOR 99999
	BEGIN 
		rollback;
		GET DIAGNOSTICS CONDITION 1 strCodigo = RETURNED_SQLSTATE, strDetalle = MESSAGE_TEXT;
		SELECT 200 as intEstatus,strCodigo,strDetalle;
	END;
	SET  lc_time_names = 'es_ES';
	Select JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Opcion')),
   			JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Usuario')),
            JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Empleado.EMP_FirmaGafete')),
            JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Empleado.EMP_Id')),
            JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Empleado.CAT_TallaCamisa'))
	INTO  strOpcion,strUsuario,intFirmaGafete,intIdEmpleado,intTallaCamisa;
    
    IF (strOpcion='G') THEN
		START TRANSACTION;
		SET AUTOCOMMIT=0;
		
		 Update dai_empleados EMPLEADOS
			Join ( select EMP_Id,CAT_TallaCamisa,CAT_TallaPantalon,EMP_Comentarios
             FROM JSON_TABLE(jsonParametros, '$.Empleado'
				COLUMNS (
		    EMP_Id  BIGINT PATH '$.EMP_Id', 
		    CAT_TallaCamisa bigint  PATH '$.CAT_TallaCamisa',
            CAT_TallaPantalon bigint  PATH '$.CAT_TallaPantalon',
		    EMP_Comentarios VARCHAR(150) PATH '$.EMP_Comentarios'
						)
			)AS TALLAS )  AS TALLAS 
				  on TALLAS.EMP_Id=EMPLEADOS.EMP_Id
        SET EMPLEADOS.CAT_TallaCamisa=TALLAS.CAT_TallaCamisa , EMPLEADOS.CAT_TallaPant=TALLAS.CAT_TallaPantalon,EMPLEADOS.EMP_ComentariosTomaTalla=TALLAS.EMP_Comentarios,EMPLEADOS.EMP_FechaTomaTalla=now();
  
      /* Update dai_empleados EMPLEADOS
			Join ( select EMP_Id,CAT_TallaSudadera,EMP_Comentarios
             FROM JSON_TABLE(jsonParametros, '$.Empleado'
				COLUMNS (
		    EMP_Id  BIGINT PATH '$.EMP_Id', 
		    CAT_TallaSudadera bigint  PATH '$.CAT_TallaSudadera',
		    EMP_Comentarios VARCHAR(150) PATH '$.EMP_Comentarios'
						)
			)AS TALLAS )  AS TALLAS 
				  on TALLAS.EMP_Id=EMPLEADOS.EMP_Id
        SET EMPLEADOS.CAT_TallaSudadera=TALLAS.CAT_TallaSudadera ,EMPLEADOS.EMP_ComentariosTomaTalla=TALLAS.EMP_Comentarios,EMPLEADOS.EMP_FechaTomaTalla=now();
            */
       
       COMMIT;

 /*
			Update dai_empleados set CAT_TallaCamisa=intTallaCamisa
			WHERE EMP_Id=intIdEmpleado;
            */
        Select 'ok' as strCodigo,'¡Información Guardada Correctamente!' as strDetalle;
        
	END IF;
    IF (strOpcion='C') THEN
		SELECT 	EMPLEADOS.EMP_Id as Id,
				EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
				EMPLEADOS.EMP_Nombre as NOMBRE,
				AREA.CAT_Nombre as AREA,
				IFNULL(TURNO.CAT_NOMBRE,'') AS TURNO,
				PUESTO.CAT_NOMBRE AS PUESTO,
				IFNULL(TALLA_CAMISA.CAT_Clave,'') AS CAMISA,
				IFNULL(TALLA_PANTALON.CAT_Clave,'')AS PANTALON,
                IFNULL(TALLA_SUDADERA.CAT_Clave,'')AS SUDADERA,
                EMPLEADOS.EMP_ComentariosTomaTalla AS COMENTARIOS
		FROM 	DAI_EMPLEADOS EMPLEADOS
				Join DAI_CATALOGOS AREA
					ON EMPLEADOS.CAT_Area=AREA.CAT_Id
				
				Join DAI_CATALOGOS PUESTO
					ON EMPLEADOS.CAT_Puesto=PUESTO.CAT_Id
				Left Join DAI_CATALOGOS TURNO 
					ON EMPLEADOS.CAT_Turno=TURNO.CAT_Id
				Left JoIN dai_catalogos TALLA_CAMISA
					on TALLA_CAMISA.CAT_Id=ifnull(EMPLEADOS.CAT_TallaCamisa,0)
				Left JoIN dai_catalogos TALLA_PANTALON
					on TALLA_PANTALON.CAT_Id=ifnull(EMPLEADOS.CAT_TallaPant,0)
				Left JoIN dai_catalogos TALLA_SUDADERA
					on TALLA_SUDADERA.CAT_Id=ifnull(EMPLEADOS.CAT_TallaSudadera,0)
			Where EMPLEADOS.EMP_ACTIVO=1;
           	
	END IF;
	IF (strOpcion='CI') THEN
		Select EMPLEADOS.EMP_FechaIngreso,EMPLEADOS.PAQ_Id,EMPLEADOS.EMP_Activo,EMPLEADOS.EMP_Id,EMPLEADOS.EMP_FechaEntrega FROM dai_empleados EMPLEADOS WHERE EMPLEADOS.EMP_FirmaGafete = intFirmaGafete or EMPLEADOS.EMP_Id=intIdEmpleado
        Into dteFechaIngreso,intIdPaquete,blnActivo,intIdEmpleado,dteFechaEntrega;
		
        IF (SELECT count(*) FROM dai_empleados EMPLEADOS WHERE EMPLEADOS.EMP_Id = intIdEmpleado )=0 THEN
			SIGNAL SQLSTATE VALUE '99999'
			SET MESSAGE_TEXT = '¡No existe el empleado!';
		END IF;
       /*  IF  year(dteFechaIngreso)=YEAR(now())  THEN
			SIGNAL SQLSTATE VALUE '99999'
			SET MESSAGE_TEXT = '¡No se puede realizar la entrega por la fecha de ingreso!';
		END IF;
        */
        SELECT 		EMPLEADOS.EMP_Id as Id,
					EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
                    EMPLEADOS.EMP_FirmaGafete as FIRMA_GAFETE,
                    EMPLEADOS.EMP_Nombre	as NOMBRE_EMPLEADO,
                    AREA.CAT_NOMBRE			AS AREA,
                    PUESTO.CAT_NOMBRE 		AS PUESTO,
                    DATE_FORMAT(EMPLEADOS.EMP_FechaIngreso,"%d %M %Y") as FECHA_INGRESO
		FROM 		dai_empleados EMPLEADOS 			
					Join dai_catalogos AREA
						on AREA.CAT_Id=EMPLEADOS.CAT_Area
					Join dai_catalogos PUESTO
						on PUESTO.CAT_Id=EMPLEADOS.CAT_PUESTO   
		WHERE		EMPLEADOS.EMP_Id=intIdEmpleado;
        
		 Select CATALOGO.CAT_Id as Id,
				CATALOGO.CAT_CLAVE AS NOMBRE
		From 	dai_catalogos_tipo CATALOGO_TIPO
				Join dai_catalogos CATALOGO
					on CATALOGO.CTT_Id=CATALOGO_TIPO.CTT_Id
				Join dai_catalogos_extras CATALOGO_EXTRA
					on CATALOGO_EXTRA.CAT_Id=CATALOGO.CAT_Id and CATALOGO_EXTRA.CAX_Tipo='Division' and CATALOGO_EXTRA.CAX_Valor='Top'
		Where	CATALOGO_TIPO.CTT_Clave='TALL'
		order by CATALOGO.CAT_Orden;
		
        Select 	CATALOGO.CAT_Id as Id,
				CATALOGO.CAT_CLAVE AS NOMBRE
		From 	dai_catalogos_tipo CATALOGO_TIPO
				Join dai_catalogos CATALOGO
					on CATALOGO.CTT_Id=CATALOGO_TIPO.CTT_Id
				Join dai_catalogos_extras CATALOGO_EXTRA
					on CATALOGO_EXTRA.CAT_Id=CATALOGO.CAT_Id and CATALOGO_EXTRA.CAX_Tipo='Division' and CATALOGO_EXTRA.CAX_Valor='Pant'
		Where	CATALOGO_TIPO.CTT_Clave='TALL'
		order by CATALOGO.CAT_Orden;
    END IF;
	

	
END//
DELIMITER ;

