            JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.IdPrenda')),
             JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Entrega.ENT_Comentarios')) ,
             JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Entrega.ENT_Vale')),
             JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Entrega.Id'))
	INTO  strOpcion,strUsuario,intFirmaGafete,intIdEmpleado,intIdPaquete,intIdTalla,intIdPrenda,strComentariosEntrega,strValeEntrega,intId;

    IF (strOpcion='CET') THEN
		Select 	EXISTENCIA.EXI_Cantidad AS CANTIDAD 
        From	dai_existencias EXISTENCIA 
        Where	EXISTENCIA.PRE_Id=intIdPrenda and EXISTENCIA.CAT_Talla=intIdTalla;
    END IF;
	IF (strOpcion='CIP') THEN
    	Select 	EMPLEADOS.CAT_TallaCamisa,
				EMPLEADOS.CAT_TallaPant ,
                TALLA_CAMISA.CAT_CLAVE ,
                TALLA_PANTALON.CAT_CLAVE
        FROM 	dai_empleados EMPLEADOS 
				Join dai_catalogos TALLA_CAMISA
					ON TALLA_CAMISA.CAT_Id=EMPLEADOS.CAT_TallaCamisa
				Join dai_catalogos TALLA_PANTALON
					ON TALLA_PANTALON.CAT_Id=EMPLEADOS.CAT_TallaPant
        WHERE  EMPLEADOS.EMP_Id=intIdEmpleado
        Into intIdTallaCamisa,intIdTallaPantalon,strTallaCamisa,strTallaPantalon;
		
		IF intIdTallaCamisa>0 THEN
			Select	PRENDAS.PRE_Id as Id,
					PRENDAS.PRE_NOMBRE AS NOMBRE,
                    CASE WHEN PRENDAS.PRE_CATEGORIA ='PLAYERA' THEN PRENDAS.PRE_CATEGORIA ELSE concat('CAMISA ',PRENDAS.PRE_SUBCATEGORIA) END AS CATEGORIA,
                    PAQUETE_DETALLE.PAD_CANTIDAD AS CANTIDAD,
					PAQUETE_DETALLE.PAD_CANTIDAD AS CANTIDAD_ENTREGA,
                    EXISTENCIAS.EXI_CANTIDAD AS EXISTENCIA,
                    intIdTallaCamisa as CAT_TALLA,
                    strTallaCamisa AS TALLA
			From	dai_paquetes_entrega_detalle PAQUETE_DETALLE
					Join dai_prendas PRENDAS
						ON PRENDAS.PRE_Id=PAQUETE_DETALLE.PRE_Id
					Join dai_existencias EXISTENCIAS
						ON EXISTENCIAS.PRE_Id=PRENDAS.PRE_Id and EXISTENCIAS.CAT_Talla=intIdTallaCamisa
					Left Join (
						Select 	DETALLE.PRE_Id,
								SUM(DETALLE.MOD_CANTIDAD) AS CANTIDAD
                        From 	dai_movimientos ENTREGA
								Join dai_movimientos_detalle DETALLE
									on ENTREGA.MOV_Id=DETALLE.MOV_Id
						Where	ENTREGA.EMP_iD=intIdEmpleado And ENTREGA.CAT_Tipo=55
                        Group by  	DETALLE.PRE_Id
						)as ENTREGA on ENTREGA.PRE_Id=PAQUETE_DETALLE.PRE_Id
			Where	PAQUETE_DETALLE.PAQ_Id=intIdPaquete AND PRENDAS.PRE_DIVISION='TOP' and (PAQUETE_DETALLE.PAD_CANTIDAD -ifnull(ENTREGA.CANTIDAD,0) )>0
            Union	all
            Select	PRENDAS.PRE_Id as Id,
					PRENDAS.PRE_NOMBRE AS NOMBRE,
                    PRENDAS.PRE_CATEGORIA  AS CATEGORIA,
                    PAQUETE_DETALLE.PAD_CANTIDAD AS CANTIDAD,
					PAQUETE_DETALLE.PAD_CANTIDAD AS CANTIDAD_ENTREGA,
                    EXISTENCIAS.EXI_CANTIDAD AS EXISTENCIA,
                    intIdTallaPantalon as CAT_TALLA,
                    strTallaPantalon AS TALLA
			From	dai_paquetes_entrega_detalle PAQUETE_DETALLE
					Join dai_prendas PRENDAS
						ON PRENDAS.PRE_Id=PAQUETE_DETALLE.PRE_Id
					Join dai_existencias EXISTENCIAS
						ON EXISTENCIAS.PRE_Id=PRENDAS.PRE_Id and EXISTENCIAS.CAT_Talla=intIdTallaPantalon
					Left Join (
						Select 	DETALLE.PRE_Id,
								SUM(DETALLE.MOD_CANTIDAD) AS CANTIDAD
                        From 	dai_movimientos ENTREGA
								Join dai_movimientos_detalle DETALLE
									on ENTREGA.MOV_Id=DETALLE.MOV_Id
						Where	ENTREGA.EMP_iD=intIdEmpleado And ENTREGA.CAT_Tipo=55
                        Group by  	DETALLE.PRE_Id
						)as ENTREGA on ENTREGA.PRE_Id=PAQUETE_DETALLE.PRE_Id
			Where	PAQUETE_DETALLE.PAQ_Id=intIdPaquete AND PRENDAS.PRE_DIVISION='PANT' and (PAQUETE_DETALLE.PAD_CANTIDAD -ifnull(ENTREGA.CANTIDAD,0) )>0;
        
        ELSE
			Select	PRENDAS.PRE_Id as Id,
					PRENDAS.PRE_NOMBRE AS NOMBRE,
                    CASE WHEN PRENDAS.PRE_CATEGORIA IN ('PANTALON','PLAYERA') THEN PRENDAS.PRE_CATEGORIA ELSE concat('CAMISA ',PRENDAS.PRE_SUBCATEGORIA) END AS CATEGORIA,
                    PAQUETE_DETALLE.PAD_CANTIDAD AS CANTIDAD,
					PAQUETE_DETALLE.PAD_CANTIDAD AS CANTIDAD_ENTREGA,
                    0 AS EXISTENCIA
                    
			From	dai_paquetes_entrega_detalle PAQUETE_DETALLE
					Join dai_prendas PRENDAS
						ON PRENDAS.PRE_Id=PAQUETE_DETALLE.PRE_Id
					Left Join (
						Select 	DETALLE.PRE_Id,
								SUM(DETALLE.MOD_CANTIDAD) AS CANTIDAD
                        From 	dai_movimientos ENTREGA
								Join dai_movimientos_detalle DETALLE
									on ENTREGA.MOV_Id=DETALLE.MOV_Id
						Where	ENTREGA.EMP_iD=intIdEmpleado And ENTREGA.CAT_Tipo=55
                        Group by  	DETALLE.PRE_Id
						)as ENTREGA on ENTREGA.PRE_Id=PAQUETE_DETALLE.PRE_Id
			Where	PAQUETE_DETALLE.PAQ_Id=intIdPaquete and (PAQUETE_DETALLE.PAD_CANTIDAD -ifnull(ENTREGA.CANTIDAD,0) )>0;

        END IF;
	END IF;
    IF (strOpcion='CEE') THEN
		Select		concat('FOLIO ',ENTREGA.MOV_Id) as FOLIO,
					ENTREGA.MOV_Id as Id,
					 DATE_FORMAT(ENTREGA.MOV_FechaHora,"%d %M %Y") as FECHA,
                    CONCAT( TIPO.CAT_NOMBRE,' ', ENTREGA.MOV_DOCUMENTO) as COMENTARIOS,
                     ENTREGA.MOV_USUARIO as USUARIO,
                     sum(DETALLE.MOD_CANTIDAD) AS CANTIDAD
        From		dai_movimientos ENTREGA
					Join dai_movimientos_detalle DETALLE
						ON ENTREGA.MOV_Id=DETALLE.MOV_Id
					Join dai_catalogos TIPO
						on TIPO.CAT_Id=ENTREGA.CAT_Tipo
		Where		ENTREGA.EMP_Id=intIdEmpleado AND ENTREGA.CAT_Tipo in (55,56,57)
        group	by ENTREGA.MOV_Id,ENTREGA.MOV_FechaHora,  ENTREGA.MOV_DOCUMENTO,ENTREGA.MOV_USUARIO,TIPO.CAT_NOMBRE;
	END IF;
      IF (strOpcion='CDE') THEN
		Select		PRENDA.PRE_NOMBRE AS PRENDA,
                     sum(DETALLE.MOD_CANTIDAD) AS CANTIDAD
        From		dai_movimientos ENTREGA
					Join dai_movimientos_detalle DETALLE
						ON ENTREGA.MOV_Id=DETALLE.MOV_Id
					Join dai_prendas PRENDA
						on PRENDA.PRE_Id=DETALLE.PRE_Id
		Where		ENTREGA.EMP_Id=intIdEmpleado AND ENTREGA.CAT_Tipo in (55)
        group	by PRENDA.PRE_NOMBRE;
	END IF;
    IF (strOpcion='CI') THEN
		Select EMPLEADOS.EMP_FechaIngreso,EMPLEADOS.PAQ_Id,EMPLEADOS.EMP_Activo,EMPLEADOS.EMP_Id,EMPLEADOS.EMP_FechaEntrega,EMPLEADOS.CAT_TallaCamisa,EMPLEADOS.CAT_TallaPant,EMPLEADOS.CAT_TallaSudadera,EMPLEADOS.EST_Id FROM dai_empleados EMPLEADOS WHERE EMPLEADOS.EMP_FirmaGafete = intFirmaGafete or EMPLEADOS.EMP_Id=intIdEmpleado
        Into dteFechaIngreso,intIdPaquete,blnActivo,intIdEmpleado,dteFechaEntrega,intIdTallaCamisa,intIdTallaPantalon,intIdTallaSudadera,intEstatus;
		
        IF (SELECT count(*) FROM dai_empleados EMPLEADOS WHERE EMPLEADOS.EMP_Id = intIdEmpleado )=0 THEN
			SIGNAL SQLSTATE VALUE '99999'
			SET MESSAGE_TEXT = '¡No existe el empleado!';
		END IF;
