	END IF; 
    IF (strOpcion='CCA') THEN
			IF (SELECT count(*) FROM dai_movimientos MOVIMIENTOS  WHERE MOVIMIENTOS.EMP_Id = intIdEmpleado and MOVIMIENTOS.CAT_Tipo=55 )=0 THEN
				SIGNAL SQLSTATE VALUE '99999'
				SET MESSAGE_TEXT = '¡No existe entregas para el empleado!';
			END IF;
			SELECT 		EMPLEADOS.EMP_Id as Id,
						EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
						EMPLEADOS.EMP_FirmaGafete as FIRMA_GAFETE,
						EMPLEADOS.EMP_Nombre	as NOMBRE_EMPLEADO,
						PAQUETE.PAQ_NOMBRE		AS NOMBRE_PAQUETE,
						AREA.CAT_NOMBRE			AS AREA,
						PUESTO.CAT_NOMBRE 		AS PUESTO,
						DATE_FORMAT(EMPLEADOS.EMP_FechaIngreso,"%d %M %Y") as FECHA_INGRESO,
						EMPLEADOS.PAQ_Id as PAQ_Id,
						PAQUETE.PAQ_NOMBRE AS PAQUETE,
						EMPLEADOS.CAT_TallaCamisa as CAT_TALLA_CAMISA,
						EMPLEADOS.CAT_TallaPant as CAT_TALLA_PANTALON,
						TALLA_CAMISA.CAT_Clave as TALLA_CAMISA,
						TALLA_PANTALON.CAT_Clave as TALLA_PANTALON,
						'' as COMENTARIOS_ENTREGA,
                        IfNull(EMPLEADOS.EMP_ComentariosTomaTalla,'') AS COMENTARIOS_TOMA_TALLA
			FROM 		dai_empleados EMPLEADOS 
						Join dai_paquetes_entrega PAQUETE
							on EMPLEADOS.PAQ_Id=PAQUETE.PAQ_Id
						Join dai_catalogos AREA
							on AREA.CAT_Id=EMPLEADOS.CAT_Area
						Join dai_catalogos PUESTO
							on PUESTO.CAT_Id=EMPLEADOS.CAT_PUESTO   
						Left Join dai_catalogos TALLA_CAMISA
							on TALLA_CAMISA.CAT_Id=EMPLEADOS.CAT_TallaCamisa
						Left Join dai_catalogos TALLA_PANTALON
							on TALLA_PANTALON.CAT_Id=EMPLEADOS.CAT_TallaPant
			WHERE		EMPLEADOS.EMP_Id=intIdEmpleado;
			
			Select	   PAQUETE.PAQ_Id as Id,
					   PAQUETE.PAQ_Nombre as NOMBRE
			From		dai_paquetes_entrega PAQUETE
			Where		PAQUETE.PAQ_Activo=1;
            
            Select 	CATALOGO.CAT_Id as Id,
					CATALOGO.CAT_CLAVE AS NOMBRE
			From 	dai_catalogos_tipo CATALOGO_TIPO
					Join dai_catalogos CATALOGO
						on CATALOGO.CTT_Id=CATALOGO_TIPO.CTT_Id
					Join dai_catalogos_extras CATALOGO_EXTRA
						on CATALOGO_EXTRA.CAT_Id=CATALOGO.CAT_Id and CATALOGO_EXTRA.CAX_Tipo='Division' and CATALOGO_EXTRA.CAX_Valor='Top'
			Where	CATALOGO_TIPO.CTT_Clave='TALL'
			order by CATALOGO.CAT_Orden;
			
			Select 	CATALOGO.CAT_Id as Id,
					CATALOGO.CAT_CLAVE AS NOMBRE
			From 	dai_catalogos_tipo CATALOGO_TIPO
					Join dai_catalogos CATALOGO
						on CATALOGO.CTT_Id=CATALOGO_TIPO.CTT_Id
					Join dai_catalogos_extras CATALOGO_EXTRA
						on CATALOGO_EXTRA.CAT_Id=CATALOGO.CAT_Id and CATALOGO_EXTRA.CAX_Tipo='Division' and CATALOGO_EXTRA.CAX_Valor='Pant'
			Where	CATALOGO_TIPO.CTT_Clave='TALL'
			order by CATALOGO.CAT_Orden;	
			
			Select	PRENDAS.PRE_Id as Id,
					PRENDAS.PRE_NOMBRE AS NOMBRE,
					PRENDAS.PRE_DIVISION AS DIVISION
			From 	dai_prendas PRENDAS
				Where	PRENDAS.PRE_Activo=1;
            
            Select	PRENDAS.PRE_Id as Id,
					PRENDAS.PRE_NOMBRE AS NOMBRE,
                    CASE WHEN PRENDAS.PRE_CATEGORIA ='PLAYERA' THEN PRENDAS.PRE_CATEGORIA ELSE concat('CAMISA ',PRENDAS.PRE_SUBCATEGORIA) END AS CATEGORIA,
                    DETALLE.MOD_CANTIDAD AS CANTIDAD_ENTREGA,
                    EXISTENCIAS.EXI_CANTIDAD AS EXISTENCIA,
                    DETALLE.CAT_Talla as CAT_TALLA,
                    TALLA.CAT_Clave as TALLA
			From	dai_movimientos MOVIMIENTOS
					Join dai_movimientos_detalle DETALLE
						on MOVIMIENTOS.MOV_Id=DETALLE.MOV_Id
					Join dai_prendas PRENDAS
						ON PRENDAS.PRE_Id=DETALLE.PRE_Id
					Join dai_existencias EXISTENCIAS
						ON EXISTENCIAS.PRE_Id=PRENDAS.PRE_Id and EXISTENCIAS.CAT_Talla=DETALLE.CAT_Talla
					Join dai_catalogos TALLA
						ON TALLA.CAT_Id=EXISTENCIAS.CAT_Talla
			Where	MOVIMIENTOS.CAT_Tipo=55 and MOVIMIENTOS.EMP_Id=intIdEmpleado  AND PRENDAS.PRE_DIVISION='TOP'
            Union	all
            Select	PRENDAS.PRE_Id as Id,
					PRENDAS.PRE_NOMBRE AS NOMBRE,
                    PRENDAS.PRE_CATEGORIA  AS CATEGORIA,
					DETALLE.MOD_CANTIDAD AS CANTIDAD_ENTREGA,
                    EXISTENCIAS.EXI_CANTIDAD AS EXISTENCIA,
                    DETALLE.CAT_Talla as CAT_TALLA,
                    TALLA.CAT_Clave as TALLA
			From	dai_movimientos MOVIMIENTOS
					Join dai_movimientos_detalle DETALLE
						on MOVIMIENTOS.MOV_Id=DETALLE.MOV_Id
					Join dai_prendas PRENDAS
						ON PRENDAS.PRE_Id=DETALLE.PRE_Id
					Join dai_existencias EXISTENCIAS
						ON EXISTENCIAS.PRE_Id=PRENDAS.PRE_Id and EXISTENCIAS.CAT_Talla=DETALLE.CAT_Talla
					Join dai_catalogos TALLA
						ON TALLA.CAT_Id=EXISTENCIAS.CAT_Talla
			Where	MOVIMIENTOS.CAT_Tipo=55 and MOVIMIENTOS.EMP_Id=intIdEmpleado AND PRENDAS.PRE_DIVISION='PANT';
        
			
			
			
    END IF;
	IF (strOpcion='C') THEN
		SELECT 	EMPLEADOS.EMP_Id as Id,
				EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
				EMPLEADOS.EMP_Nombre as NOMBRE,
				AREA.CAT_Nombre as AREA,
				TURNO.CAT_NOMBRE AS TURNO,
				PUESTO.CAT_NOMBRE AS PUESTO,
				PAQUETES_ENTREGA.PAQ_NOMBRE AS PAQUETE,
				TALLA_CAMISA.CAT_Clave AS CAMISA,
				TALLA_PANTALON.CAT_Clave AS PANTALON,
                TALLA_SUDADERA.CAT_Clave as SUDADERA,
                EMPLEADOS.EMP_Activo as ACTIVO,
                ESTATUS.EST_Nombre as ESTATUS
		FROM 	DAI_EMPLEADOS EMPLEADOS
				Join DAI_CATALOGOS AREA
					ON EMPLEADOS.CAT_Area=AREA.CAT_Id
				Join DAI_CATALOGOS TURNO 
					ON EMPLEADOS.CAT_Turno=TURNO.CAT_Id
				Join DAI_CATALOGOS PUESTO
					ON EMPLEADOS.CAT_Puesto=PUESTO.CAT_Id
				Join DAI_PAQUETES_ENTREGA PAQUETES_ENTREGA
					ON EMPLEADOS.PAQ_Id=PAQUETES_ENTREGA.PAQ_Id
				Join dai_estatus ESTATUS
					on ESTATUS.EST_Id=EMPLEADOS.EST_Id
				Left JoIN dai_catalogos TALLA_CAMISA
					on TALLA_CAMISA.CAT_Id=EMPLEADOS.CAT_TallaCamisa
				Left JoIN dai_catalogos TALLA_PANTALON
					on TALLA_PANTALON.CAT_Id=EMPLEADOS.CAT_TallaPant
                Left JoIN dai_catalogos TALLA_SUDADERA
					on TALLA_SUDADERA.CAT_Id=EMPLEADOS.CAT_TallaSudadera    
			Where EMPLEADOS.EMP_Activo=1;
	END IF;
	IF (strOpcion='EE') THEN
		Select  MOVIMIENTO.EMP_Id 
        From	dai_movimientos MOVIMIENTO
        Where	MOVIMIENTO.MOV_Id=intId
        Into	intIdEmpleado;
    
		START TRANSACTION;
		SET AUTOCOMMIT=0;
				UPDATE  dai_movimientos SET CAT_Tipo=58,MOV_UsuarioRetorna=strUsuario,MOV_ENTRADA=1
				WHERE	MOV_Id=intId;
                
                Update dai_existencias EXISTENCIAS
						Join dai_movimientos_detalle DETALLE
							on EXISTENCIAS.PRE_Id=DETALLE.PRE_Id and EXISTENCIAS.CAT_Talla=DETALLE.CAT_Talla AND DETALLE.MOV_Id=intId
                SET		EXISTENCIAS.EXI_Cantidad=EXI_Cantidad-DETALLE.MOD_CANTIDAD;
                
                Update dai_empleados SET EST_Id=1
                where EMP_Id=intIdEmpleado;
                
        COMMIT;
	END IF;
    IF (strOpcion='GC') THEN
		START TRANSACTION;
		SET AUTOCOMMIT=0;
			MOV_FECHA,
            MOV_FECHAHora,
            MOV_DOCUMENTO,
            MOV_USUARIO,
            MOV_ENTRADA,
            CAT_TIPO,
            EMP_Id,
            PAQ_Id
        )
		SELECT DISTINCT 
				NOW(),
                NOW(),
                 ENT_Comentarios  ,
				 strUsuario,
                 1,
                 56,
                 EMP_Id,
				 PAQ_Id
		FROM JSON_TABLE(jsonParametros, '$.Entrega'
				COLUMNS (
				EMP_Id  BIGINT PATH '$.EMP_Id', 
				PAQ_Id bigint  PATH '$.PAQ_Id',
				ENT_Comentarios VARCHAR(150) PATH '$.ENT_Comentarios'
				)
			) AS entrega;	
			
		set intId=LAST_INSERT_ID();
			MOV_Id,
            PRE_Id,
            CAT_Talla,
            MOD_Cantidad
        )
        
        SELECT 	DISTINCT 
				intId,
				PRE_Id,
				CAT_Talla,
				Cantidad 
		FROM JSON_TABLE(jsonParametros, '$.Entrega.Entrada[*]'
		    COLUMNS (
			CAT_Talla BIGINT PATH '$.CAT_Talla', 
		    PRE_Id  BIGINT PATH '$.PRE_Id', 
		    Cantidad BIGINT  PATH '$.Cantidad'
		    )
		) AS detalle;
		
        Update dai_existencias EXISTENCIA
        Join (SELECT 	DISTINCT 
				PRE_Id,
				CAT_Talla,
				Cantidad 
				FROM JSON_TABLE(jsonParametros, '$.Entrega.Entrada[*]'
					COLUMNS (
					CAT_Talla BIGINT PATH '$.CAT_Talla', 
					PRE_Id  BIGINT PATH '$.PRE_Id', 
					Cantidad BIGINT  PATH '$.Cantidad'
							) 
				)as detalle) AS detalle
			on EXISTENCIA.PRE_Id=detalle.PRE_Id and EXISTENCIA.CAT_Talla=DETALLE.CAT_Talla
         SET EXI_CANTIDAD=EXI_CANTIDAD+detalle.cantidad;
			MOV_FECHA,
            MOV_FECHAHora,
            MOV_DOCUMENTO,
            MOV_USUARIO,
            MOV_ENTRADA,
            CAT_TIPO,
            EMP_Id,
            PAQ_Id
        )
		SELECT DISTINCT 
				NOW(),
                NOW(),
                 ENT_Comentarios  ,
				 strUsuario,
                 0,
                 57,
                 EMP_Id,
				 PAQ_Id
		FROM JSON_TABLE(jsonParametros, '$.Entrega'
				COLUMNS (
				EMP_Id  BIGINT PATH '$.EMP_Id', 
				PAQ_Id bigint  PATH '$.PAQ_Id',
				ENT_Comentarios VARCHAR(150) PATH '$.ENT_Comentarios'
				)
			) AS entrega;	
			
		set intIdSalida=LAST_INSERT_ID();
			MOV_Id,
            PRE_Id,
            CAT_Talla,
            MOD_Cantidad
        )
        
        SELECT 	DISTINCT 
				intIdSalida,
				PRE_Id,
				CAT_Talla,
				Cantidad 
		FROM JSON_TABLE(jsonParametros, '$.Entrega.Salida[*]'
		    COLUMNS (
			CAT_Talla BIGINT PATH '$.CAT_Talla', 
		    PRE_Id  BIGINT PATH '$.PRE_Id', 
		    Cantidad BIGINT  PATH '$.Cantidad'
		    )
		) AS detalle;
		
        Update dai_existencias EXISTENCIA
        Join (SELECT 	DISTINCT 
				PRE_Id,
				CAT_Talla,
				Cantidad 
				FROM JSON_TABLE(jsonParametros, '$.Entrega.Salida[*]'
					COLUMNS (
					CAT_Talla BIGINT PATH '$.CAT_Talla', 
					PRE_Id  BIGINT PATH '$.PRE_Id', 
					Cantidad BIGINT  PATH '$.Cantidad'
							) 
				)as detalle) AS detalle
			on EXISTENCIA.PRE_Id=detalle.PRE_Id and EXISTENCIA.CAT_Talla=DETALLE.CAT_Talla
         SET EXI_CANTIDAD=EXI_CANTIDAD-detalle.cantidad;
    	
        
		 COMMIT;
    END IF;
	IF (strOpcion='G') THEN
		Select EMPLEADOS.EMP_FechaIngreso FROM dai_empleados EMPLEADOS WHERE EMPLEADOS.EMP_FirmaGafete = intFirmaGafete or EMPLEADOS.EMP_Id=intIdEmpleado
        Into dteFechaIngreso;
		
	IF  year(dteFechaIngreso)=YEAR(now()) and  ifnull(strComentariosEntrega,'')='' THEN
			SIGNAL SQLSTATE VALUE '99999'
			SET MESSAGE_TEXT = '¡No se puede realizar la entrega por la fecha de ingreso, favor de cargar referencia!';
		END IF;
        
		SELECT 	 SUM(Cantidad) 
		FROM JSON_TABLE(jsonParametros, '$.Entrega.Detalle[*]'
		    COLUMNS (
			CAT_Talla BIGINT PATH '$.CAT_Talla', 
		    PRE_Id  BIGINT PATH '$.PRE_Id', 
		    Cantidad BIGINT  PATH '$.Cantidad'
		    )
		) AS detalle
        Into intCantidadEntrega;
        
        IF ifnull(intCantidadEntrega,0)=0 THEN
			SIGNAL SQLSTATE VALUE '99999'
			SET MESSAGE_TEXT = '¡Entrega sin detalle de prendas!';
        END IF;
        
		START TRANSACTION;
		SET AUTOCOMMIT=0;
			MOV_FECHA,
            MOV_FECHAHora,
            MOV_DOCUMENTO,
            MOV_USUARIO,
            MOV_ENTRADA,
            CAT_TIPO,
            EMP_Id,
            PAQ_Id
        )
		SELECT DISTINCT 
				NOW(),
                NOW(),
                ENT_Comentarios,
				 strUsuario,
                 0,
                 55,
                 EMP_Id,
				 PAQ_Id
		FROM JSON_TABLE(jsonParametros, '$.Entrega'
				COLUMNS (
				EMP_Id  BIGINT PATH '$.EMP_Id', 
				PAQ_Id bigint  PATH '$.PAQ_Id',
				ENT_Comentarios VARCHAR(150) PATH '$.ENT_Comentarios'
				)
			) AS entrega;	
			
		set intId=LAST_INSERT_ID();
			MOV_Id,
            PRE_Id,
            CAT_Talla,
            MOD_Cantidad
        )
        
        SELECT 	DISTINCT 
				intId,
				PRE_Id,
				CAT_Talla,
				Cantidad 
		FROM JSON_TABLE(jsonParametros, '$.Entrega.Detalle[*]'
		    COLUMNS (
			CAT_Talla BIGINT PATH '$.CAT_Talla', 
		    PRE_Id  BIGINT PATH '$.PRE_Id', 
		    Cantidad BIGINT  PATH '$.Cantidad'
		    )
		) AS detalle;
        
	/*	SELECT 	 SUM(Cantidad) 
		FROM JSON_TABLE(jsonParametros, '$.Entrega.Detalle[*]'
		    COLUMNS (
			CAT_Talla BIGINT PATH '$.CAT_Talla', 
		    PRE_Id  BIGINT PATH '$.PRE_Id', 
		    Cantidad BIGINT  PATH '$.Cantidad'
		    )
		) AS detalle
        Into intCantidadEntrega; */
        
        
        SELECT 	 SUM(DETALLE.MOD_CANTIDAD) 
		From	dai_movimientos ENTREGA
				Join dai_movimientos_detalle DETALLE
					on DETALLE.MOV_Id=ENTREGA.MOV_Id
        Where	ENTREGA.EMP_Id=intIdEmpleado and ENTREGA.CAT_Tipo=55        
        Into 	intCantidadEntrega;
        
        Select 	SUM(PAQUETE.PAD_CANTIDAD)
        From	dai_paquetes_entrega_detalle PAQUETE
		Where	PAQUETE.PAQ_Id=intIdPaquete		
		Into	intCantidadPaquete;
        
        IF (intCantidadEntrega<intCantidadPaquete) THEN
			UPDATE  dai_empleados SET EST_Id=CASE WHEN EST_Id =3 THEN 3 ELSE 2 END ,EMP_ComentariosUltimaEntrega=strComentariosEntrega,PAQ_Id=case when EST_Id=1 then intIdPaquete else PAQ_ID END,EMP_FechaUltimaEntrega=now()
            WHERE	EMP_Id=intIdEmpleado;	
        ELSE
			UPDATE  dai_empleados SET EST_Id=3,EMP_ComentariosUltimaEntrega=strComentariosEntrega,PAQ_Id=case when EST_Id=1 then intIdPaquete else PAQ_ID END,EMP_FechaUltimaEntrega=now()
            WHERE	EMP_Id=intIdEmpleado;
        END IF;
		
        Update dai_existencias EXISTENCIA
        Join (SELECT 	DISTINCT 
				PRE_Id,
				CAT_Talla,
				Cantidad 
				FROM JSON_TABLE(jsonParametros, '$.Entrega.Detalle[*]'
					COLUMNS (
					CAT_Talla BIGINT PATH '$.CAT_Talla', 
					PRE_Id  BIGINT PATH '$.PRE_Id', 
					Cantidad BIGINT  PATH '$.Cantidad'
							) 
				)as detalle) AS detalle
			on EXISTENCIA.PRE_Id=detalle.PRE_Id and EXISTENCIA.CAT_Talla=DETALLE.CAT_Talla
         SET EXI_CANTIDAD=EXI_CANTIDAD-detalle.cantidad;

		COMMIT;

        /*Select 'ok' as strCodigo,'¡Información Guardada Correctamente!' as strDetalle;*/
        
     	SELECT 	ENTREGA.MOV_Id as Id,
				ENTREGA.MOV_Usuario as USUARIO,
				ENTREGA.MOV_FechaHora as FECHA,
                ENTREGA.MOV_DOCUMENTO as COMENTARIOS,
				EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
				EMPLEADOS.EMP_Nombre as NOMBRE,
				AREA.CAT_Nombre as AREA,
				PUESTO.CAT_NOMBRE AS PUESTO
		FROM 	dai_movimientos ENTREGA
				JOin DAI_EMPLEADOS EMPLEADOS
					on ENTREGA.EMP_Id=EMPLEADOS.EMP_Id
				Join DAI_CATALOGOS AREA
					ON EMPLEADOS.CAT_Area=AREA.CAT_Id
				Join DAI_CATALOGOS PUESTO
					ON EMPLEADOS.CAT_Puesto=PUESTO.CAT_Id
		Where	ENTREGA.MOV_Id=intId;
        
		Select	PRENDA.PRE_NOMBRE AS PRENDA,	
				TALLA.CAT_Clave as TALLA,
				ENTREGA_DETALLE.MOD_CANTIDAD AS CANTIDAD
        From	dai_movimientos_detalle ENTREGA_DETALLE
				Join dai_prendas PRENDA
					on PRENDA.PRE_Id=ENTREGA_DETALLE.PRE_Id
				Join dai_catalogos TALLA
					on TALLA.CAT_Id=ENTREGA_DETALLE.CAT_Talla
        Where	ENTREGA_DETALLE.MOV_Id=intId;
        

	END IF;
	
	
   
	END//
DELIMITER ;

-- Volcando estructura para procedimiento daimler.PA_DAICapInventarios
DELIMITER //
CREATE PROCEDURE `PA_DAICapInventarios`(IN jsonParametros JSON)
BEGIN
	DECLARE 	strOpcion varchar(10) ;
	DECLARE 	strUsuario VARCHAR(30);
	DECLARE 	strCodigo varchar(10) ;
	DECLARE		strDetalle varchar(255);	
	DECLARE		intEstatus INT ;
	DECLARE		intId			BIGINT;
    DECLARE		blnEntrada	bigint;
	
    DECLARE EXIT HANDLER FOR SQLEXCEPTION 
	BEGIN 
		rollback;
		GET DIAGNOSTICS CONDITION 1 strCodigo = RETURNED_SQLSTATE, strDetalle= MESSAGE_TEXT;
		SELECT 200 as intEstatus,strCodigo,strDetalle as strDetalle;
	END;
	DECLARE EXIT HANDLER FOR 99999
	BEGIN 
		rollback;
		GET DIAGNOSTICS CONDITION 1 strCodigo = RETURNED_SQLSTATE, strDetalle = MESSAGE_TEXT;
		SELECT 200 as intEstatus,strCodigo,strDetalle;
	END;
	SET  lc_time_names = 'es_ES';
    select JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Opcion')),
			JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Usuario')),
            JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Ajuste.Entrada'))
	INTO  strOpcion,strUsuario,blnEntrada;
			/*	 */
    IF (strOpcion='C') THEN
          
      Select 	PRENDA.PRE_NOMBRE AS PRENDA,
                TALLA.CAT_Clave AS TALLA,
                concat(PRENDA.PRE_NOMBRE,' - ', TALLA.CAT_Clave) as PRENDA_COMPLETA,
                EXISTENCIA.EXI_CANTIDAD As CANTIDAD,
                PRENDA.PRE_Id as Id,
                EXISTENCIA.CAT_TALLA AS CAT_TALLA
        From	dai_existencias EXISTENCIA
				Join dai_prendas PRENDA
					on PRENDA.PRE_Id=EXISTENCIA.PRE_Id
				Join dai_catalogos TALLA
					on TALLA.CAT_Id=EXISTENCIA.CAT_Talla
		order	by PRENDA,TALLA.CAT_ORDEN;

    END IF;
    IF (strOpcion='RE') THEN
		START TRANSACTION;
		SET AUTOCOMMIT=0;
				Update dai_existencias EXISTENCIAS
						Left Join 
							(Select DETALLE.PRE_Id,
									DETALLE.CAT_Talla,
									SUM(DETALLE.MOD_CANTIDAD) AS CANTIDAD
							From 	dai_movimientos MOVIMIENTOS
									Join dai_movimientos_detalle DETALLE
										on MOVIMIENTOS.MOV_Id=DETALLE.MOV_Id
							Where	MOVIMIENTOS.MOV_ENTRADA=1 
							group by 	DETALLE.PRE_Id,
									DETALLE.CAT_Talla) as ENTRADAS
							on EXISTENCIAS.PRE_Id=ENTRADAS.PRE_Id and EXISTENCIAS.CAT_Talla=ENTRADAS.CAT_Talla
						Left Join 
							(Select DETALLE.PRE_Id,
									DETALLE.CAT_Talla,
									SUM(DETALLE.MOD_CANTIDAD) AS CANTIDAD
							From 	dai_movimientos MOVIMIENTOS
									Join dai_movimientos_detalle DETALLE
										on MOVIMIENTOS.MOV_Id=DETALLE.MOV_Id
							Where	MOVIMIENTOS.MOV_ENTRADA=0
							group by 	DETALLE.PRE_Id,
									DETALLE.CAT_Talla     
							) as SALIDAS
                            on EXISTENCIAS.PRE_Id=SALIDAS.PRE_Id and EXISTENCIAS.CAT_Talla=SALIDAS.CAT_Talla
                  SET		EXISTENCIAS.EXI_Cantidad=ifnull(ENTRADAS.CANTIDAD,0)-ifnull(SALIDAS.CANTIDAD,0);
        COMMIT;
                  -- Select 'ok' as strCodigo,'¡Información Guardada Correctamente!' as strDetalle;
	END IF;
	IF (strOpcion='G') THEN
		START TRANSACTION;
		SET AUTOCOMMIT=0;
        
			MOV_FECHA,
            MOV_FECHAHora,
            MOV_DOCUMENTO,
            MOV_USUARIO,
            MOV_ENTRADA,
            CAT_TIPO
        )
		SELECT DISTINCT 
				NOW(),
                NOW(),
                Comentarios,
				 strUsuario,
                 Entrada,
                 case when Entrada=1 then 59 else 60 end

		FROM JSON_TABLE(jsonParametros, '$.Ajuste'
				COLUMNS (
				Comentarios VARCHAR(150) PATH '$.Comentarios',
                Entrada bigint PATH '$.Entrada'
				)
			) AS ajuste;	
            
		set intId=LAST_INSERT_ID();
			MOV_Id,
            PRE_Id,
            CAT_Talla,
            MOD_Cantidad
        )
         SELECT 	DISTINCT 
				intId,
				PRE_Id,
				CAT_Talla,
				Cantidad 
		FROM JSON_TABLE(jsonParametros, '$.Ajuste'
		    COLUMNS (
			CAT_Talla BIGINT PATH '$.CAT_Talla', 
		    PRE_Id  BIGINT PATH '$.PRE_Id', 
		    Cantidad BIGINT  PATH '$.Cantidad'
		    )
		) AS detalle;
        
        
         If (blnEntrada=1) then
				Update dai_existencias EXISTENCIAS
					Join ( select PRE_Id,CAT_Talla,Cantidad
					 FROM JSON_TABLE(jsonParametros, '$.Ajuste'
						COLUMNS (
					PRE_Id  BIGINT PATH '$.PRE_Id', 
					CAT_Talla bigint  PATH '$.CAT_Talla',
					Cantidad bigint  PATH '$.Cantidad'
								)
					)AS AJUSTE )  AS AJUSTE 
						  on EXISTENCIAS.PRE_Id=AJUSTE.PRE_Id and EXISTENCIAS.CAT_Talla=AJUSTE.CAT_Talla
			 SET EXISTENCIAS.EXI_CANTIDAD= EXI_CANTIDAD+ AJUSTE.CANTIDAD ;
         else
			 Update dai_existencias EXISTENCIAS
				Join ( select PRE_Id,CAT_Talla,Cantidad
				 FROM JSON_TABLE(jsonParametros, '$.Ajuste'
					COLUMNS (
				PRE_Id  BIGINT PATH '$.PRE_Id', 
				CAT_Talla bigint  PATH '$.CAT_Talla',
				Cantidad bigint  PATH '$.Cantidad'
							)
				)AS AJUSTE )  AS AJUSTE 
					  on EXISTENCIAS.PRE_Id=AJUSTE.PRE_Id and EXISTENCIAS.CAT_Talla=AJUSTE.CAT_Talla
			 SET EXISTENCIAS.EXI_CANTIDAD= EXI_CANTIDAD- AJUSTE.CANTIDAD ;
         
         END IF;
            
            COMMIT;

 
        
	END IF;
    
        
END//
DELIMITER ;

-- Volcando estructura para procedimiento daimler.PA_DAICapMovimientos
DELIMITER //
CREATE PROCEDURE `PA_DAICapMovimientos`(IN jsonParametros JSON)
BEGIN
	DECLARE 	strOpcion varchar(10) ;
	DECLARE 	strUsuario VARCHAR(30);
	DECLARE 	strCodigo varchar(10) ;
	DECLARE		strDetalle varchar(255);	
	DECLARE		intEstatus INT ;
	DECLARE		intId			BIGINT;
	
    DECLARE EXIT HANDLER FOR SQLEXCEPTION 
	BEGIN 
		rollback;
		GET DIAGNOSTICS CONDITION 1 strCodigo = RETURNED_SQLSTATE, strDetalle= MESSAGE_TEXT;
		SELECT 200 as intEstatus,strCodigo,strDetalle as strDetalle;
	END;
	DECLARE EXIT HANDLER FOR 99999
	BEGIN 
		rollback;
		GET DIAGNOSTICS CONDITION 1 strCodigo = RETURNED_SQLSTATE, strDetalle = MESSAGE_TEXT;
		SELECT 200 as intEstatus,strCodigo,strDetalle;
	END;
	SET  lc_time_names = 'es_ES';
    select JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Opcion')),
			JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Usuario'))

	INTO  strOpcion,strUsuario;
    IF (strOpcion='CE') THEN
		Select 	
				PRENDA.PRE_NOMBRE AS PRENDA,
                TALLA.CAT_Clave AS TALLA,
                EXISTENCIA.EXI_CANTIDAD As EXISTENCIA
        From	dai_existencias EXISTENCIA
				Join dai_prendas PRENDA
					on PRENDA.PRE_Id=EXISTENCIA.PRE_Id
				Join dai_catalogos TALLA
					on TALLA.CAT_Id=EXISTENCIA.CAT_Talla;
    END IF;
        
END//
DELIMITER ;

-- Volcando estructura para procedimiento daimler.PA_DAIConReportesEntrega
DELIMITER //
CREATE PROCEDURE `PA_DAIConReportesEntrega`(IN jsonParametros JSON)
BEGIN

	DECLARE 	strOpcion varchar(10) ;
	DECLARE 	strUsuario VARCHAR(30);
    DECLARE 	intHC 		BIGINT;
     DECLARE 	intRegistrados 	BIGINT;
     DECLARE	intRegistradosDia bigint;
     DECLARE	intPorcentaje	bigint;
     DECLARE	intEntrega INT;
     DECLARE 	intHora int;
     DECLARE 	dteFechaInicio datetime;
     DECLARE	dateFechaFin datetime;
     
    Select JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Opcion')),
   			JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Usuario'))
	INTO  strOpcion,strUsuario;
	/*Resumen de refacturada*/
	If (strOpcion='CRF') THEN
		Select 	NUMERO_ENTREGA.CAL_NombreEntrega AS ENTREGA,
				PRENDA.PRE_TIPO AS PRENDA,
				SUM(DETALLE.MOD_CANTIDAD) AS CANTIDAD,
                PRENDA.PRE_PRECIO AS PRECIO,
                SUM(DETALLE.MOD_CANTIDAD)*  PRENDA.PRE_PRECIO AS IMPORTE
        From  	dai_movimientos MOVIMIENTOs
				Join dai_movimientos_detalle DETALLE
					on MOVIMIENTOS.MOV_Id=DETALLE.MOV_Id
				Join dai_prendas PRENDA
					on PRENDA.PRE_Id=DETALLE.PRE_Id
				Join dai_entregas_calendario NUMERO_ENTREGA
					on NUMERO_ENTREGA.CAL_FECHA=MOVIMIENTOS.MOV_FECHA
        Where	MOVIMIENTOS.CAT_Tipo in (55)
        GROUP	BY 	NUMERO_ENTREGA.CAL_NombreEntrega ,
					PRENDA.PRE_TIPO,
					PRENDA.PRE_PRECIO;
    END IF;
    /*Resumen General*/
	If (strOpcion='C') THEN
			Select 	count(*)
            From	dai_empleados EMPLEADOS
					Join dai_catalogos AREA
						ON AREA.CAT_Id=EMPLEADOS.CAT_Area
					Join dai_catalogos PUESTO
						ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
					Where	EMPLEADOS.EMP_Activo=1 
			Into intHC;
            
            Select 	count(*)
            From	dai_empleados EMPLEADOS
					Join dai_catalogos AREA
						ON AREA.CAT_Id=EMPLEADOS.CAT_Area
					Join dai_catalogos PUESTO
						ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
			Where	EMPLEADOS.EMP_Activo=1 and EMPLEADOS.EST_Id<>1 
            Into	intRegistrados;
			
			Select  HOUR(now()) hour
			Into	intHora;
            
            IF   intHora <8 THEN
					Set @dteFechaInicio=cast(DATE_ADD( now(), INTERVAL -1 DAY) as date);
					Set @dteFechaInicio=DATE_ADD( @dteFechaInicio, INTERVAL 8 HOUR);
            ELSE
					Set @dteFechaInicio=cast( now() as date);
					Set @dteFechaInicio=DATE_ADD( @dteFechaInicio, INTERVAL 8 HOUR);
            
            END IF;
            
			Select 	count(*)
            From	dai_empleados EMPLEADOS
					Join dai_catalogos AREA
						ON AREA.CAT_Id=EMPLEADOS.CAT_Area
					Join dai_catalogos PUESTO
						ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
			Where	EMPLEADOS.EMP_Activo=1 and EMPLEADOS.EST_Id<>1 
            and EMPLEADOS.EMP_FechaUltimaEntrega between  @dteFechaInicio and  now() 
            Into	intRegistradosDia;
            
			select (intRegistrados*100) / intHC
            Into intPorcentaje;
            
            Select intHC as HC, intRegistrados AS REGISTRADOS,intRegistradosDia as REGISTRADOS_DIA, intPorcentaje AS PORCENTAJE;
            
      END IF;
      /*Resumen General */
    If (strOpcion='CR') THEN
		CREATE TEMPORARY TABLE IF NOT EXISTS dttEntrega
		 (
			Cantidad int,
			Area varchar(50) DEFAULT NULL,
            ClaveArea varchar(30) DEFAULT NULL,
			Puesto varchar(50) DEFAULT NULL
		);
		CREATE TEMPORARY TABLE IF NOT EXISTS dttHC
		 (
			Cantidad int,
			Area varchar(50) DEFAULT NULL,
			ClaveArea varchar(30) DEFAULT NULL,
			Puesto varchar(50) DEFAULT NULL
		);
		Select 	count(EMPLEADOS.EMP_Id)  as HC,
				AREA.CAT_Nombre as AREA,
                AREA.CAT_Clave as CLAVE_AREA,
                PUESTO.CAT_Nombre as PUESTO
		from 	dai_empleados EMPLEADOS
				Join dai_catalogos AREA
					ON AREA.CAT_Id=EMPLEADOS.CAT_Area
				Join dai_catalogos PUESTO
					ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto		
		Where	EMPLEADOS.EMP_Activo=1 And EMPLEADOS.EST_Id<>1 and  PUESTO.CAT_Clave NOT IN ('TL','BGD','CSH') 
        /*and AREA.CAT_CLAVE IN ('CIW','PCH','OFFLINE','BEFORE','FCH','FCB','PINTURA','MRG','HR','CTS','MATERIALES','CALIDAD','TOS')*/
		 group 	by AREA.CAT_Nombre,PUESTO.CAT_Nombre,  AREA.CAT_Clave;

        
		Select 	count(EMPLEADOS.EMP_Id) ,
				AREA.CAT_Nombre as AREA,
                 AREA.CAT_Clave as CLAVE_AREA,
                PUESTO.CAT_Nombre as PUESTO
		from 	dai_empleados EMPLEADOS
				Join dai_catalogos AREA
					ON AREA.CAT_Id=EMPLEADOS.CAT_Area
				Join dai_catalogos PUESTO
					ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
		Where	EMPLEADOS.EMP_Activo=1 and  PUESTO.CAT_Clave NOT IN ('TL','BGD','CSH') 
        /*and AREA.CAT_CLAVE IN ('CIW','PCH','OFFLINE','BEFORE','FCH','FCB','PINTURA','MRG','HR','CTS','MATERIALES','CALIDAD','TOS')*/
		group 	by AREA.CAT_Nombre,PUESTO.CAT_Nombre,  AREA.CAT_Clave;

        Select  HC.AREA,HC.PUESTO,HC.CANTIDAD AS HC, IfNull(Entrega.CANTIDAD,0) AS REGISTRADOS ,HC.CANTIDAD  -IfNull(Entrega.CANTIDAD,0)  as FALTANTES, (IfNull(Entrega.CANTIDAD,0)*100 )/HC.CANTIDAD as PORCENTAJE
		From 	dttHC HC 
				Join dai_catalogos AREA
					on AREA.CAT_Clave=HC.ClaveArea
				Left Join dttEntrega Entrega 
					on HC.ClaveArea=Entrega.ClaveArea And HC.Puesto=Entrega.Puesto
         Order by AREA.CAT_Orden   asc    ;
		drop table dttEntrega;
		drop table dttHC;    
    END IF;
    /*Resumen Especialidades*/
     If (strOpcion='CRE') THEN
		CREATE TEMPORARY TABLE IF NOT EXISTS dttEntrega
		 (
			Cantidad int,
			Area varchar(50) DEFAULT NULL,
			Puesto varchar(50) DEFAULT NULL
		);
		CREATE TEMPORARY TABLE IF NOT EXISTS dttHC
		 (
			Cantidad int,
			Area varchar(50) DEFAULT NULL,
			Puesto varchar(50) DEFAULT NULL
		);
		Select 	count(EMPLEADOS.EMP_Id)  as HC,AREA.CAT_Nombre as AREA,PUESTO.CAT_Nombre as PUESTO
		from 	dai_empleados EMPLEADOS
				Join dai_catalogos AREA
					ON AREA.CAT_Id=EMPLEADOS.CAT_Area
				Join dai_catalogos PUESTO
					ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto		
		Where	EMPLEADOS.EMP_Activo=1 And EMPLEADOS.EST_Id<>1 and  PUESTO.CAT_Clave  IN ('TL','BGD','CSH') 
                /*and  PUESTO.CAT_Clave  IN ('TL','BGD','CSH') */
		 group 	by AREA.CAT_Nombre,PUESTO.CAT_Nombre;

        
		Select 	count(EMPLEADOS.EMP_Id) ,AREA.CAT_Nombre as AREA,PUESTO.CAT_Nombre as PUESTO
		from 	dai_empleados EMPLEADOS
				Join dai_catalogos AREA
					ON AREA.CAT_Id=EMPLEADOS.CAT_Area
				Join dai_catalogos PUESTO
					ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
		Where	EMPLEADOS.EMP_Activo=1  and  PUESTO.CAT_Clave IN ('TL','BGD','CSH') 
        /*and  PUESTO.CAT_Clave  IN ('TL','BGD','CSH') */
		group 	by AREA.CAT_Nombre,PUESTO.CAT_Nombre;

        Select  HC.AREA,HC.PUESTO,HC.CANTIDAD AS HC, IfNull(Entrega.CANTIDAD,0) AS REGISTRADOS ,HC.CANTIDAD  -IfNull(Entrega.CANTIDAD,0)  as FALTANTES, (IfNull(Entrega.CANTIDAD,0)*100 )/HC.CANTIDAD as PORCENTAJE
		From 	dttHC HC 
				Left Join dttEntrega Entrega 
					on HC.Area=Entrega.Area And HC.Puesto=Entrega.Puesto;
                
		drop table dttEntrega;
		drop table dttHC;    
    END IF;
    /*Consulta de faltantes*/
	If (strOpcion='CEF') THEN
		SELECT 	EMPLEADOS.EMP_Id as Id,
				EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
				EMPLEADOS.EMP_Nombre as NOMBRE,
				AREA.CAT_Nombre as AREA,
               /* EMPLEADOS.CAT_Turno as TURNO,
                TALLA_SUDADERA.CAT_Clave as TURNO,*/
				/*CASE WHEN EMPLEADOS.EMP_Activo=1 THEN 'Activo' ELSE 'Baja' END AS TURNO,*/
           ifnull(TALLA_ENTREGADA.TALLA, TALLA_SUDADERA.CAT_Clave) as TURNO,
				PUESTO.CAT_Nombre AS PUESTO
            
		FROM 	DAI_EMPLEADOS EMPLEADOS
				Join DAI_CATALOGOS AREA
					ON EMPLEADOS.CAT_Area=AREA.CAT_Id
				Join DAI_CATALOGOS TURNO 
					ON EMPLEADOS.CAT_Turno=TURNO.CAT_Id
				Join DAI_CATALOGOS PUESTO
					ON EMPLEADOS.CAT_Puesto=PUESTO.CAT_Id
				Left Join (
					Select 	distinct MOVIMIENTO.EMP_Id,
							MAX(TALLA.CAT_Clave) as TALLA
					From 	dai_movimientos MOVIMIENTO
							Join dai_movimientos_detalle DETALLE
								on MOVIMIENTO.MOV_Id=DETALLE.MOV_Id
							Join dai_prendas PRENDA
								on PRENDA.PRE_Id=DETALLE.PRE_Id
							Join dai_catalogos TALLA
								on TALLA.CAT_Id=DETALLE.CAT_Talla
					Where PRENDA.PRE_Tipo IN ('SUDADERA') AND MOVIMIENTO.CAT_Tipo=55
					Group by MOVIMIENTO.EMP_Id
						) AS TALLA_ENTREGADA 
							on TALLA_ENTREGADA.EMP_Id=EMPLEADOS.EMP_Id
				Left Join dai_catalogos TALLA_CAMISA	
					on TALLA_CAMISA.CAT_Id=EMPLEADOS.CAT_TallaCamisa
				Left Join dai_catalogos TALLA_PANTALON	
					on TALLA_PANTALON.CAT_Id=EMPLEADOS.CAT_TallaPant
				Left Join dai_catalogos TALLA_SUDADERA	
					on TALLA_SUDADERA.CAT_Id=EMPLEADOS.CAT_TallaSudadera
		Where	EMPLEADOS.EST_Id=3 And EMPLEADOS.EMP_Activo=1  ;
        /*and AREA.CAT_CLAVE IN ('CIW','PCH','OFFLINE','BEFORE','FCH','FCB','PINTURA','MRG','MATERIALES','TOS')  AND PUESTO.CAT_Clave Not In  ('TL','BGD','CSH')
        Union 	all
        SELECT 	EMPLEADOS.EMP_Id as Id,
				EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
				EMPLEADOS.EMP_Nombre as NOMBRE,
				AREA.CAT_Nombre as AREA,
				TURNO.CAT_NOMBRE AS TURNO,
				PUESTO.CAT_NOMBRE AS PUESTO
            
		FROM 	DAI_EMPLEADOS EMPLEADOS
				Join DAI_CATALOGOS AREA
					ON EMPLEADOS.CAT_Area=AREA.CAT_Id
				Join DAI_CATALOGOS TURNO 
					ON EMPLEADOS.CAT_Turno=TURNO.CAT_Id
				Join DAI_CATALOGOS PUESTO
					ON EMPLEADOS.CAT_Puesto=PUESTO.CAT_Id
		Where	EMPLEADOS.EST_Id=1 and EMPLEADOS.EMP_Activo=1 aND PUESTO.CAT_Clave =  'TL'  ;*/
		
    END IF;
    /*Consulta de registrados*/
	If (strOpcion='CER') THEN
        Select 	ENTREGA.CAL_NumeroEntrega
        From	dai_entregas_calendario ENTREGA
        Where	ENTREGA.CAL_FECHA=CAST(now() as DATE)
        Into	intEntrega;
        
        CREATE TEMPORARY TABLE IF NOT EXISTS dttEntrega
		 (
			idEmpleado 		bigint,
            idMovimiento 	bigint,
            Tipo			varchar(15),
			Cantidad 		bigint DEFAULT NULL
		);
        Select  MOVIMIENTOS.EMP_Id,
				MOVIMIENTOS.MOV_Id,
				PRENDA.PRE_TIpo,
                Sum(DETALLE.MOD_CANTIDAD)
        From	dai_movimientos MOVIMIENTOS
				JOin dai_movimientos_detalle DETALLE
					on MOVIMIENTOS.MOV_Id=DETALLE.MOV_Id 
				Join dai_prendas PRENDA
					on PRENDA.PRE_Id=DETALLE.PRE_Id
				Join dai_entregas_calendario ENTREGA
					ON ENTREGA.CAL_FECHA=MOVIMIENTOS.MOV_FECHA AND ENTREGA.CAL_NumeroEntrega=intEntrega
	Where		MOVIMIENTOS.CAT_Tipo=55
		group 	by MOVIMIENTOS.EMP_Id,
				PRENDA.PRE_TIpo,	
                MOVIMIENTOS.MOV_Id;

		SELECT 	MOVIMIENTOS.MOV_FechaHora as FECHA,
				MOVIMIENTOS.MOV_Id as FOLIO,
				EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
				EMPLEADOS.EMP_Nombre as NOMBRE,
				AREA.CAT_Nombre as AREA,
				PUESTO.CAT_NOMBRE AS PUESTO,
                MOVIMIENTOS.MOV_DOCUMENTO AS COMENTARIOS,
                ifnull(CAMISA.Cantidad,0) AS CAMISA,
				ifnull(PANTALON_MEZC.Cantidad,0) AS PANTALON_MEZC,
                ifnull(PANT_GAB.Cantidad,0) as PANT_GAB,
				ifnull(PLAYERA.Cantidad,0) as PLAYERA,
				ifnull(CAMISA_BGD.Cantidad,0) as CAMISA_BGD,
				ifnull(PANT_BGD.Cantidad,0) as PANT_BGD,
               	ifnull(SUDADERA.Cantidad,0) as SUDADERA,
				sum(ifnull(ENTREGA_TOTAL.CANTIDAD,0)) as TOTAL
		FROM 	dai_movimientos MOVIMIENTOS
				Join DAI_EMPLEADOS EMPLEADOS
					on EMPLEADOS.EMP_Id=MOVIMIENTOS.EMP_Id
				Join DAI_CATALOGOS AREA
					ON EMPLEADOS.CAT_Area=AREA.CAT_Id
				Join DAI_CATALOGOS TURNO 
					ON EMPLEADOS.CAT_Turno=TURNO.CAT_Id
				Join DAI_CATALOGOS PUESTO
					ON EMPLEADOS.CAT_Puesto=PUESTO.CAT_Id
				Join dai_entregas_calendario ENTREGA
					ON ENTREGA.CAL_FECHA=MOVIMIENTOS.MOV_FECHA AND ENTREGA.CAL_NumeroEntrega=intEntrega
				Left Join dttEntrega CAMISA 
					on CAMISA.idEmpleado=EMPLEADOS.EMP_Id And Camisa.Tipo='CAMISA' and CAMISA.idMovimiento=MOVIMIENTOS.MOV_Id
                Left Join dttEntrega PANTALON_MEZC 
					on PANTALON_MEZC.idEmpleado=EMPLEADOS.EMP_Id And PANTALON_MEZC.Tipo='PANT_MEZC' and PANTALON_MEZC.idMovimiento=MOVIMIENTOS.MOV_Id
                Left Join dttEntrega PANT_GAB 
					on PANT_GAB.idEmpleado=EMPLEADOS.EMP_Id And PANT_GAB.Tipo='PANT_GAB' and PANT_GAB.idMovimiento=MOVIMIENTOS.MOV_Id
                 Left Join dttEntrega PLAYERA 
					on PLAYERA.idEmpleado=EMPLEADOS.EMP_Id And PLAYERA.Tipo='PLAYERA' and PLAYERA.idMovimiento=MOVIMIENTOS.MOV_Id
                 Left Join dttEntrega CAMISA_BGD 
					on CAMISA_BGD.idEmpleado=EMPLEADOS.EMP_Id And CAMISA_BGD.Tipo='CAMISA_BGD'      and CAMISA_BGD.idMovimiento=MOVIMIENTOS.MOV_Id
				Left Join dttEntrega PANT_BGD 
					on PANT_BGD.idEmpleado=EMPLEADOS.EMP_Id And PANT_BGD.Tipo='PANT_BGD' AND PANT_BGD.idMovimiento=MOVIMIENTOS.MOV_Id
				Left Join dttEntrega SUDADERA 
					on SUDADERA.idEmpleado=EMPLEADOS.EMP_Id And SUDADERA.Tipo='SUDADERA' AND SUDADERA.idMovimiento=MOVIMIENTOS.MOV_Id
                 Left Join dttEntrega ENTREGA_TOTAL  
					on ENTREGA_TOTAL.idEmpleado=EMPLEADOS.EMP_Id     aND ENTREGA_TOTAL.idMovimiento=MOVIMIENTOS.MOV_Id  
		Where	EMPLEADOS.EST_Id<>1 and MOVIMIENTOS.CAT_Tipo=55
		GROUP	BY MOVIMIENTOS.MOV_Fecha ,
				MOVIMIENTOS.MOV_Id ,
				EMPLEADOS.EMP_NumeroEmpleado ,
				EMPLEADOS.EMP_Nombre ,
				AREA.CAT_Nombre ,
				PUESTO.CAT_NOMBRE ,
                  MOVIMIENTOS.MOV_DOCUMENTO ,
                ifnull(CAMISA.Cantidad,0) ,
				ifnull(PANTALON_MEZC.Cantidad,0) ,
                ifnull(PANT_GAB.Cantidad,0) ,
				ifnull(PLAYERA.Cantidad,0) ,
				ifnull(CAMISA_BGD.Cantidad,0) ,
				ifnull(PANT_BGD.Cantidad,0)
               ;
    
    END IF;
    
    



    



	
END//
DELIMITER ;

-- Volcando estructura para procedimiento daimler.PA_DAIConReportesTomaTallas
DELIMITER //
CREATE PROCEDURE `PA_DAIConReportesTomaTallas`(IN jsonParametros JSON)
BEGIN

	DECLARE 	strOpcion varchar(10) ;
	DECLARE 	strUsuario VARCHAR(30);
    DECLARE 	intHC 		BIGINT;
     DECLARE 	intRegistrados 	BIGINT;
          DECLARE	intRegistradosDia bigint;
     DECLARE	intPorcentaje	bigint;
          DECLARE 	intHora int;
    Select JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Opcion')),
   			JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Usuario'))
	INTO  strOpcion,strUsuario;
      If (strOpcion='CRD') THEN
			Select 	count(*)
            From	dai_empleados EMPLEADOS
					Join dai_catalogos AREA
						ON AREA.CAT_Id=EMPLEADOS.CAT_Area
					Join dai_catalogos PUESTO
						ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
			Where	EMPLEADOS.EMP_Activo=1  AND ( AREA.CAT_Clave In ('MRG','SPARK','TOS','FAC','CTS')   AND PUESTO.CAT_Clave <> ('TL') )
			Into intHC;
            
            
            Select 	count(*)
            From	dai_empleados EMPLEADOS
					Join dai_catalogos AREA
						ON AREA.CAT_Id=EMPLEADOS.CAT_Area
					Join dai_catalogos PUESTO
						ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
			Where	EMPLEADOS.EMP_Activo=1 and Ifnull(EMPLEADOS.CAT_TallaCamisa,0)>0 
            Into	intRegistrados;
            
            Select  HOUR(now()) hour
			Into	intHora;
            
            IF   intHora <8 THEN
					Set @dteFechaInicio=cast(DATE_ADD( now(), INTERVAL -1 DAY) as date);
					Set @dteFechaInicio=DATE_ADD( @dteFechaInicio, INTERVAL 8 HOUR);
            ELSE
					Set @dteFechaInicio=cast( now() as date);
					Set @dteFechaInicio=DATE_ADD( @dteFechaInicio, INTERVAL 8 HOUR);
            
            END IF;
            Select 	count(*)
            From	dai_empleados EMPLEADOS
					Join dai_catalogos AREA
						ON AREA.CAT_Id=EMPLEADOS.CAT_Area
					Join dai_catalogos PUESTO
						ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
			Where	EMPLEADOS.EMP_Activo=1 and EMPLEADOS.EST_Id<>1 
            and EMPLEADOS.EMP_FechaTomaTalla between  @dteFechaInicio and  now() 
            Into	intRegistradosDia;
            
			select (intRegistrados*100) / intHC
            Into intPorcentaje;
            
            Select intHC as HC, intRegistrados AS REGISTRADOS,intRegistradosDia as REGISTRADOS_DIA, intPorcentaje AS PORCENTAJE;

      END IF;
    If (strOpcion='CR') THEN
		CREATE TEMPORARY TABLE IF NOT EXISTS dttTallaTomada 
		 (
			Cantidad int,
			Area varchar(50) DEFAULT NULL,
			Puesto varchar(50) DEFAULT NULL
		);
		CREATE TEMPORARY TABLE IF NOT EXISTS dttHC
		 (
			Cantidad int,
			Area varchar(50) DEFAULT NULL,
			Puesto varchar(50) DEFAULT NULL
		);
		Select 	count(EMPLEADOS.EMP_Id)  as HC,AREA.CAT_Nombre as AREA,PUESTO.CAT_Nombre as PUESTO
		from 	dai_empleados EMPLEADOS
				Join dai_catalogos AREA
					ON AREA.CAT_Id=EMPLEADOS.CAT_Area
				Join dai_catalogos PUESTO
					ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto		
		Where	EMPLEADOS.EMP_Activo=1 And EMPLEADOS.CAT_TallaCamisa>0 
		 group 	by AREA.CAT_Nombre,PUESTO.CAT_Nombre;
        
		Select 	count(EMPLEADOS.EMP_Id) ,AREA.CAT_Nombre as AREA,PUESTO.CAT_Nombre as PUESTO
		from 	dai_empleados EMPLEADOS
				Join dai_catalogos AREA
					ON AREA.CAT_Id=EMPLEADOS.CAT_Area
				Join dai_catalogos PUESTO
					ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
		Where	EMPLEADOS.EMP_Activo=1   AND ( AREA.CAT_Clave In ('MRG','SPARK','TOS','FAC','CTS')   AND PUESTO.CAT_Clave <> ('TL') )
		   group 	by AREA.CAT_Nombre,PUESTO.CAT_Nombre;
     
		
        Select  distinct HC.AREA,HC.PUESTO,HC.CANTIDAD AS HC, IfNull(TallaTomada.CANTIDAD,0) AS REGISTRADOS ,HC.CANTIDAD  -IfNull(TallaTomada.CANTIDAD,0)  as FALTANTES, (IfNull(TallaTomada.CANTIDAD,0)*100 )/HC.CANTIDAD as PORCENTAJE
		From 	dttHC HC 
			Left Join dttTallaTomada TallaTomada 
				on HC.Area=TallaTomada.Area And HC.Puesto=TallaTomada.Puesto;

        
		drop table dttTallaTomada;
		drop table dttHC;    
    END IF;
	If (strOpcion='CEF') THEN
		SELECT 	EMPLEADOS.EMP_Id as Id,
				EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
				EMPLEADOS.EMP_Nombre as NOMBRE,
				AREA.CAT_Nombre as AREA,
				TURNO.CAT_NOMBRE AS TURNO,
				PUESTO.CAT_NOMBRE AS PUESTO
            
		FROM 	DAI_EMPLEADOS EMPLEADOS
				Join DAI_CATALOGOS AREA
					ON EMPLEADOS.CAT_Area=AREA.CAT_Id
				Join DAI_CATALOGOS TURNO 
					ON EMPLEADOS.CAT_Turno=TURNO.CAT_Id
				Join DAI_CATALOGOS PUESTO
					ON EMPLEADOS.CAT_Puesto=PUESTO.CAT_Id
		Where	ifnull(EMPLEADOS.CAT_TallaCamisa,0)=0 AND EMPLEADOS.EMP_Activo=1 AND ( AREA.CAT_Clave In ('MRG','SPARK','TOS','FAC','CTS')   AND PUESTO.CAT_Clave <> ('TL') ) ;
		
    END IF;
    	If (strOpcion='CER') THEN
		SELECT 	EMPLEADOS.EMP_Id as Id,
				EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
				EMPLEADOS.EMP_Nombre as NOMBRE,
				AREA.CAT_Nombre as AREA,
				TURNO.CAT_NOMBRE AS TURNO,
				PUESTO.CAT_NOMBRE AS PUESTO,
				IFNULL(TALLA_CAMISA.CAT_CLAVE,'') AS CAMISA,
				IFNULL(TALLA_PANTALON.CAT_Nombre,'')AS PANTALON,
                IFNULL(TALLA_SUDADERA.CAT_CLAVE,'')AS SUDADERA,
                EMPLEADOS.EMP_ComentariosTomaTalla AS COMENTARIOS
		FROM 	DAI_EMPLEADOS EMPLEADOS
				Join DAI_CATALOGOS AREA
					ON EMPLEADOS.CAT_Area=AREA.CAT_Id
				Join DAI_CATALOGOS TURNO 
					ON EMPLEADOS.CAT_Turno=TURNO.CAT_Id
				Join DAI_CATALOGOS PUESTO
					ON EMPLEADOS.CAT_Puesto=PUESTO.CAT_Id
				Left JoIN dai_catalogos TALLA_CAMISA
					on TALLA_CAMISA.CAT_Id=EMPLEADOS.CAT_TallaCamisa
				Left JoIN dai_catalogos TALLA_PANTALON
					on TALLA_PANTALON.CAT_Id=EMPLEADOS.CAT_TallaPant
				Left JoIN dai_catalogos TALLA_SUDADERA
					on TALLA_SUDADERA.CAT_Id=EMPLEADOS.CAT_TallaSudadera  
		Where	EMPLEADOS.CAT_TallaCamisa>0 
      order by AREA ASC;
    END IF;
    
    



    



	
END//
DELIMITER ;

-- Volcando estructura para procedimiento daimler.PA_DAIConResumenTomaTallas
DELIMITER //
CREATE PROCEDURE `PA_DAIConResumenTomaTallas`(IN jsonParametros JSON)
BEGIN

	DECLARE 	strOpcion varchar(10) ;
	DECLARE 	strUsuario VARCHAR(30);
    Select JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Opcion')),
   			JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Usuario'))
	INTO  strOpcion,strUsuario;
    
    If (strOpcion='CR') THEN
		CREATE TEMPORARY TABLE IF NOT EXISTS dttTallaTomada 
		 (
			Cantidad int,
			Area varchar(50) DEFAULT NULL,
			Puesto varchar(50) DEFAULT NULL
		);
		CREATE TEMPORARY TABLE IF NOT EXISTS dttHC
		 (
			Cantidad int,
			Area varchar(50) DEFAULT NULL,
			Puesto varchar(50) DEFAULT NULL
		);
		Select 	count(EMPLEADOS.EMP_Id)  as HC,AREA.CAT_Nombre as AREA,PUESTO.CAT_Nombre as PUESTO
		from 	dai_empleados EMPLEADOS
				Join dai_catalogos AREA
					ON AREA.CAT_Id=EMPLEADOS.CAT_Area
				Join dai_catalogos PUESTO
					ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto		
		Where	EMPLEADOS.EMP_Activo=1 And EMPLEADOS.CAT_TallaCamisa>0
		group 	by AREA.CAT_Nombre,PUESTO.CAT_Nombre;

		Select 	count(EMPLEADOS.EMP_Id) ,AREA.CAT_Nombre as AREA,PUESTO.CAT_Nombre as PUESTO
		from 	dai_empleados EMPLEADOS
				Join dai_catalogos AREA
					ON AREA.CAT_Id=EMPLEADOS.CAT_Area
				Join dai_catalogos PUESTO
					ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
		Where	EMPLEADOS.EMP_Activo=1 
		group 	by AREA.CAT_Nombre,PUESTO.CAT_Nombre;
		
        Select  HC.AREA,HC.PUESTO,HC.CANTIDAD AS HC, IfNull(TallaTomada.CANTIDAD,0) AS REGISTRADOS ,HC.CANTIDAD  -IfNull(TallaTomada.CANTIDAD,0)  as FALTANTES, (IfNull(TallaTomada.CANTIDAD,0)*100 )/HC.CANTIDAD as PORCENTAJE
		From 	dttHC HC 
			Left Join dttTallaTomada TallaTomada 
				on HC.Area=TallaTomada.Area And HC.Puesto=TallaTomada.Puesto;

        
		drop table dttTallaTomada;
		drop table dttHC;    
    END IF;
	If (strOpcion='CEF') THEN
		SELECT 	EMPLEADOS.EMP_Id as Id,
				EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
				EMPLEADOS.EMP_Nombre as NOMBRE,
				AREA.CAT_Nombre as AREA,
				TURNO.CAT_NOMBRE AS TURNO,
				PUESTO.CAT_NOMBRE AS PUESTO
            
		FROM 	DAI_EMPLEADOS EMPLEADOS
				Join DAI_CATALOGOS AREA
					ON EMPLEADOS.CAT_Area=AREA.CAT_Id
				Join DAI_CATALOGOS TURNO 
					ON EMPLEADOS.CAT_Turno=TURNO.CAT_Id
				Join DAI_CATALOGOS PUESTO
					ON EMPLEADOS.CAT_Puesto=PUESTO.CAT_Id
		Where	EMPLEADOS.CAT_TallaCamisa=0;
    END IF;
    
    



    



	
END//
DELIMITER ;

